import React from "react";
import { ReactComponent as SidebarBtn } from '../assets/sidebar_btn.svg';
import { ReactComponent as SearchIcon } from '../assets/search.svg';

const Navbar = () => {
    return (
        <>
            <nav className="navbar navbar-expand-lg navbar-fixed-top navbar-dark bg-dark">


                    <button type="button" className="btn">
                        <SidebarBtn alt="logo" fill="white" width="32px" height="32px" />
                    </button>

                    <a className="navbar-brand" href="../">E-Shop</a>

                    <form className="form-inline my-2 my-lg-0">
                        <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
                        <button className="btn my-2 my-sm-0" type="submit">
                            <SearchIcon alt="search" fill="white" width="32px" height="32px" />
                        </button>
                    </form>

                
            </nav>
        </>
    )
}

export default Navbar;
